import React from "react";
import Sidebar from "./Components/Sidebar";
import FileUpload from "./Components/FileUpload";
import Steps from "./Components/Steps";
import "./App.css";

const App = () => {
  return (
    <div className="app-container">
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className="main-content">
        <h1>SDTM Mapping Tool</h1>
        <p>
          This application helps you map XPT f1iles to SDTM domains using LLM-powered analysis. 
          Upload your XPT files, and the tool will automatically identify domains, create mappings, 
          and generate the necessary documentation.
        </p>

        {/* Steps Navigation */}
        <Steps />

        {/* File Upload Section */}
        <FileUpload />
      </div>
    </div>
  );
};

export default App;
